            "id": "m",
            "Y": "l",
            "subs": [
                {
                    "id": "n",
                    "X": "k",
                    "subs": []
                }
            ]
        }
    ]
}

value = obj["subs"][0]["Y"]
print(value)  # 输出: l
```
